import UIKit

extension UIImage {
    static var sample: UIImage? {
        guard let sampleData = sampleData else { return nil }
        return UIImage(data: sampleData)
    }

    static var sampleData: Data? {
        guard let imageData = "".data(using: .utf8),
              let data = Data(base64Encoded: imageData) else { return nil }
        return data
    }
}
